import React from 'react';

const Overview = () => {
	return (
		<div className="home">
			<Row gutter={16}>
				<Col span={12}>
					<Statistic title="Feedback" value={1128} prefix={<LikeOutlined />} />
				</Col>
				<Col span={12}>
					<Statistic title="Unmerged" value={93} suffix="/ 100" />
				</Col>
			</Row>
		</div>
	);
};

export default Overview;
